def canJump(nums: 'List[int]'):
    if nums[0] == 0:
        if len(nums)>1:
            return False
        else:
            return True

    maxReached = 0

    for i in range(len(nums)):
        if nums[i] == 0:
            if i == maxReached:
                return False
        else:
            maxReached = max(i+nums[i], maxReached)
            if maxReached >=len(nums)-1:
                return True



print(canJump([2,3,1,1,4]))
print(canJump([0]))
print(canJump([2,0,0]))
print(canJump([5,9,3,2,1,0,2,3,3,1,0,0])) #true
